import React from "react";
import Logo from "../images/logo3.jpg";
import Instagram from "../images/logo2.jpg";
import Telegram from "../images/logo1.jpg";

const Header = () => {
  return (
    <header className="header">
      <div className="logo logo__header">
        <img src={Logo} alt="логотип" className="logo__image" />
        <ul className="header__links">
          <li><a href="#" className="header__link">Guide</a></li>
          <li><a href="#" className="header__link"></a></li>
          <li><a href="#" className="header__link">Контакты</a></li>
          <li><a href="#" className="header__link"><img src={Instagram} alt="иконка инстаграм" className="header__icon" /></a></li>
          <li><a href="#" className="header__link"><img src={Telegram} alt="иконка телеграм" className="header__icon" /></a></li>
        </ul>
      </div>
    </header>
  );
};

export default Header;
